import clsx from "clsx";
import Image from "next/image";

interface Props {
  url: string;
  width?: number;
  height?: number;
  className?: string;
}

export default function CardBanner({
  url,
  width = 351,
  height = 200,
  className,
}: Props) {
  return (
    <Image
      src={url || "/images/exercise-banner.jpg"}
      alt="Banner"
      width={width}
      height={height}
      className={clsx(
        `rounded-lg rounded-b-none object-cover w-[${width}px] h-[${height}px]`,
        className
      )}
      quality={100}
      unoptimized={true}
      placeholder="blur"
      blurDataURL="data:image/jpeg;base64,"
    />
  );
}
